  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0116982 includes Surface
  underway data collected from RYOFU MARU in the Bismarck Sea, East China Sea (Tung
  Hai), North Pacific Ocean, Philippine Sea, Sea of Japan and South Pacific Ocean
  from 1989-11-17 to 1995-03-07. These data include BAROMETRIC PRESSURE, Partial pressure
  (or fugacity) of carbon dioxide - atmosphere, Partial pressure (or fugacity) of
  carbon dioxide - water, SALINITY and SEA SURFACE TEMPERATURE. The instruments used
  to collect these data include Carbon dioxide (CO2) gas analyzer, Shower head chamber
  equilibrator for autonomous carbon dioxide (CO2) measurement, not applicable and
  thermosalinographs.nnThese data were collected by Shu Saito and Akira Nakadate of
  Japan Meteorological Agency; Pollutants Chemical Analysis Center; Marine Division;
  Global Environment and Marine Department as part of the VOS_Ryofu_Maru_1989_1995
  data set. CDIAC associated the following cruise ID(s) with this data set: 49RY19891117nnThe
  Global Volunteer Observing Ship (VOS) Program is coordinated by the UNESCO International
  Ocean Carbon Coordination Project (IOCCP). International groups from 14 countries
  have been outfitting research ships and commercial vessels with automated CO2 sampling
  equipment to analyze the carbon exchange between the ocean and atmosphere.\",\n\t\"owner_org\":
